member.returns:
The current EngineeringFormatInfo, if formatType (parameter)
is the same as the type of the current EngineeringFormatInfo;
otherwise, null.

member.param:
When this method returns,
contains the DigitalState character represented by input (parameter), if input (parameter) is a recognized character;
or the default value of DigitalState if input (parameter) was not recognized.
